import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, NavLink } from "react-router-dom";
import VizContainer from "./Components/VizContainer";
import Hairball from "./Components/Hairball";
import Hive from "./Components/Hive";
import Tree from "./Components/Tree";
import About from "./Pages/About";
import BarChart from "./Components/BarChart";
import TreeMap from "./Components/TreeMap";
import BarRace from "./Components/BarRace";
import Histogram from "./Components/Histogram";
import ParallelPlot from "./Components/ParallelPlot";
import TextCard from "./Components/TextCard";
import DashboardIntroduction from "./Components/DashboardIntro";
import "./App.css";

const GroupsHairball = ['Indie', 'Casual', 'Action', 'Adventure', 'Simulation', 'Strategy', 
  'RPG', 'Early Access', 'Free to Play', 'Sports', 'Racing', 'Massively Multiplayer', 'Utilities', 
  'Design & Illustration', 'Violent', 'Animation & Modeling', 'Education', 'Free To Play', 'Video Production', 'Gore'];

const GroupsTreeMap = ['Instagram', 'Facebook', 'Twitter', 'Snapchat', "Telegram", "LinkedIn"]

const GroupsHive = [
  "Art", "Business_Studies", "Citizenship", 
  "Design_and_Technology", "Geography", "IT", "Language_and_literature", 
  "Music", "Religion", "People", "Everyday_life", 
  "Science", "History"
];

const HairballText = "The hairball plot is a network visualization technique that is particularly useful for large networks.Nodes from the same category attract each other. Nodes from different categories repel each other. Nodes that are linked together have an attractive force between them.";
const HiveText = "Nodes represent sub-groups (one level of hierarchy) and are placed on the axis corresponding to their parent group. Links connect two sub-groups when an article from one sub-group contains a hyperlink to an article from another sub-group. The width of the link is proportional to the number of hyperlinks between sub-groups. Intra sub-group links are not displayed to keep the visualization clearer."
const TreeText = "A Tree Plot is used to visualize the hierarchy of groups and sub-groups. This helps to better understand the structure of the dataset and how different categories relate to one another.The Tree plot's construction is animated."

const sumaryText = "The dataset contains information about the number of followers, following, and tweets of various social media accounts. The data is organized into different groups, such as Instagram, Facebook, Twitter, etc. The dataset is used to create various visualizations to analyze the relationships between these groups and their respective metrics."

const BarRaceText = "This visualization is a bar race chart representing the number of active users (in millions) for each social media platform from January 2017 to October 2024. It highlights the rapid growth in user adoption, emphasizing the universal expansion of social media across different platforms. The data comes from multiple sources and has been manually aggregated into a JSON file. In most cases, user counts are averaged per quarter, but some platforms—such as Telegram—have data with a lower resolution. For recent dates, some figures are not consistently reported, which explains why Facebook’s user count remains unchanged after 2022."

const App = () => {
  return (
    <div className="App">
    <Router>
      <header className="header">
        <nav>
          <NavLink to="/" end>Vizualisation</NavLink>
          <NavLink to="/about">About the plots</NavLink>
        </nav>
      </header>

      <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/about" element={<About />} />
      </Routes>
    </Router>
    </div>
    );
  };

function Home() {
  return(
    <div className="App">
      <div className="top-container">
      <div className="logo-container">
        <img src="./steam.png" alt="WikipediaLogo" width="100"/>
      </div>
      <div className="title-container">
        <h1 className="page-title">Social Media Analysis</h1>
      </div>
    </div>

    <div className="text-container">
      <DashboardIntroduction/>
    </div>

    <div className="bar-race-viz">
      <VizContainer viz={BarRace} title={"Number of Monthly Active Users in Millions"} groups={GroupsHive} text={BarRaceText} hasSidePanel={false}/>
    </div>
    <div className="upper-viz">
      <div className="left-viz">
        <div className="treemap-barchart-viz">
            <VizContainer viz={TreeMap} title={"Tree Map"} groups={GroupsTreeMap} text={TreeText}/>
            <VizContainer viz={BarChart} title={"Bar Chart"} groups={GroupsHive} text={HiveText} hasSidePanel={false}/>
        </div>
      </div>
      <div className="right-viz">
        <TextCard title={"Social Media"} text={sumaryText}/>
      </div>  
    </div>
    {/*
    <div className="lower-viz">
      <div className="center-viz">

      </div>
    </div>
    <div className="lower-viz">
      <div className="center-viz">
        <VizContainer viz={Histogram} title={"Histogram"} groups={GroupsHive} text={TreeText} hasSidePanel={false}/>
      </div>
    </div>
    <div className="lower-viz">
      <div className="center-viz">
        <VizContainer viz={ParallelPlot} title={"Parallel Plot"} groups={GroupsHive} text={TreeText} hasSidePanel={false}/>
      </div>
    </div>
    */}
  </div>
);
}

export default App;
